; Dask Version: 2020.12.0+34.g4f4d2950 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2020.12.0+22.g74e8dc64 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1003","type":"DataRange1d"},{"attributes":{"axis":{"id":"1050"},"dimension":1,"ticker":null,"visible":false},"id":"1053","type":"Grid"},{"attributes":{},"id":"1012","type":"BasicTicker"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1146"}},"height":{"units":"data","value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1146"}},"width":{"units":"data","value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1167","type":"Rect"},{"attributes":{},"id":"1159","type":"CategoricalTicker"},{"attributes":{},"id":"1082","type":"BasicTicker"},{"attributes":{"fill_color":{"value":"blue"},"height":{"units":"data","value":1},"line_color":{"value":"blue"},"width":{"field":"bandwidth","units":"data"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1199","type":"Rect"},{"attributes":{"text":""},"id":"1223","type":"Title"},{"attributes":{"axis":{"id":"1085"},"dimension":1,"ticker":null,"visible":false},"id":"1088","type":"Grid"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt; @source &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Destination:&lt;/b&gt; @destination &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Bandwidth:&lt;/b&gt; @bandwidth_text / s&lt;/p
